To see why “t56 t23 t15” cannot be generated, we run CYK:

1.  Length‑1 spans:
    • position 1 “t56” ⇒ {NT107}  
    • position 2 “t23” ⇒ {NT66, NT73}  
    • position 3 “t15” ⇒ {NT3, NT62, NT66}

2.  No binary rule A→BC has B∈{NT107} and C∈{NT66,NT73}, so no nonterminal covers positions 1–2.

3.  No binary rule A→BC has B∈{NT66,NT73} and C∈{NT3,NT62,NT66}, so no nonterminal covers positions 2–3.

Since no nonterminal spans a length‑2 block, S (which expands to two nonterminals) cannot cover the 3‑token string.  

